import React from 'react';
import './TrailersLanding.css';
// import Man from '../background.jpg';

function Landing(){

    return(
        <div className='background'>
        <div className="header">
        <h1>NETFLIXFY</h1>
        <div className='sub-header'>
        <h3>Watch exclusive Netflix <br />movie trailers before<br /> anyone else.</h3>
        <button>Watch Now</button>
        </div>
        </div>
        
       
        

        </div>
    )
};

export default Landing;
